script: |
  super -f text -I q8291.spq | sort > q8291.out

inputs:
  - name: q8291.spq
    data: |
      SELECT + 25 FROM tab2 (FORMAT parquet) WHERE NULL NOT BETWEEN - - col1 * + col2 * + col0 AND + col2 + col2 + - col1 + + + col0 / - ( ( col0 ) ) + + - col2;
  - name: tab2

outputs:
  - name: q8291.out
    data: |
